import React from "react";

class SortingVisualizer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            arr: []
        }
    }
    componentDidMount() {
        this.resetArray();
    }
    resetArray() {
        const array = [];
        for (let i = 0; i < 100; i++) {
            array.push(randomIntegers(10, 600));
        }
        console.log(array);
        this.setState({ array });
        // console.log(arr);
    }
    render(){
        <>
            <div>Hello World</div>
        </>
    }
    
      
}
function randomIntegers(min, max) {
    // min and max included 
    return Math.floor(Math.random() * (max - min + 1) + min)
}
export default SortingVisualizer;
